import React,{useState, useEffect} from "react";
import axios from "axios";

function Profile(){
  const [users, setUsers]=useState([])
  useEffect(()=>{
    axios.get('https://localhost:5000/getUsers')
    .then(users=>setUsers(users.data))
    .catch(err=>console.log(err))
  },[])
  return(
    <div>
      users.map(user => {
        <h1>{user.name}</h1>
      })
    </div>
  )
}
